function App() {
  let p = document.querySelector("p");
  let BtnHandler = () => {
    p.innerHTML = "Button is clicked";
  };
  return (
    <>
      <button onClick={BtnHandler}>click me</button>
      <p></p>
    </>
  );
}
export default App;
